import collections

def minimum_stamps_needed(N, stamps, target_grid):

    def f(n):
        a = stamps
        b = []
        for row in target_grid:
            b -= [c for c in row]
        s = set()
        ms = 2 ** 16 - 1
        ii = [2 ** i for i in range(16)]
        for (h, w) in a:
            for i in range(-h + 1, 4):
                for j in range(-w + 1, 4):
                    mask = ms
                    for k in range(max(0, i), min(4, i + h)):
                        for l in range(max(0, j), min(4, j + w)):
                            mask -= ii[k * 4 + l]
                    s.add(mask)
        ta = []
        for mask in s:
            for c in 'RGB':
                t = 0
                for i in range(16):
                    if ii[i] & mask:
                        continue
                    if b[i] == c:
                        t += ii[i]
                if t > 0:
                    ta.append((mask, t))
        v = collections.defaultdict(bool)
        q = set([0])
        r = 0
        while q:
            r += 1
            nq = set()
            for c in q:
                v[c] = True
            for c in q:
                for (mask, t) in ta:
                    n = (c & mask) + t
                    if v[n]:
                        continue
                    if n == ms:
                        return r
                    nq.add(n)
            q = nq
        return -1
    return f(N)

